import { Link, BrowserRouter, Route } from "react-router-dom";
function App() {
	return (
		<BrowserRouter>
			<Route exact path="/">
				<div>
					<h1>Bievenido a Preguntados</h1>
					<Link to="/preguntas_inicio">Ir a las preguntas</Link>
				</div>
			</Route>
			<Route exact path="/preguntas" component={Preguntas}></Route>
		</BrowserRouter>
	);
}

export default App;
